Ext.data.JsonP['Titanium_SDK_5.3.1.RC_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Titanium SDK 5.3.1.RC - 14 June 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46252341\" class=\"content\">\n                        <h1>Titanium SDK 5.3.1.RC - 14 June 2016</h1>\n    <div class=\"section section-2 \" id=\"src-46252341_TitaniumSDK5.3.1.RCReleaseNote-Contents\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.3.1.RC_Release_Note-section-src-46252341_TitaniumSDK5.3.1.RCReleaseNote-AboutThisRelease\">About This Release</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.3.1.RC_Release_Note-section-src-46252341_TitaniumSDK5.3.1.RCReleaseNote-FixedIssues\">Fixed Issues</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.3.1.RC_Release_Note-section-src-46252341_TitaniumSDK5.3.1.RCReleaseNote-APIChanges\">API Changes</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46252341_TitaniumSDK5.3.1.RCReleaseNote-AboutThisRelease\">\n        <h2 class=\"heading \"><span>About This Release</span></h2>\n    <p>Titanium SDK 5.3.1.RC is a patch release of the SDK, addressing high-priority issues from previous releases.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46252341_TitaniumSDK5.3.1.RCReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/API-1272\" target=\"_blank\">API-1272</a> - Trying to display/read Swagger.json throws an Internal Server Error    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/API-1280\" target=\"_blank\">API-1280</a> - Swagger.json is exposing invalid schema.required array for path parameters    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/CLI-989\" target=\"_blank\">CLI-989</a> - CLI not responding on self signed certificate    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23480\" target=\"_blank\">TIMOB-23480</a> - CLI: Can&apos;t launch any app (Android, Mobileweb) on Windows 10 OS    </p>\n</li></ul>    <p>    <span id=\"src-46252341_apichanges\"><a name=\"src-46252341_apichanges\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46252341_TitaniumSDK5.3.1.RCReleaseNote-APIChanges\">\n        <h2 class=\"heading \"><span>API Changes</span></h2>\n    <p>No APIs were modified for this release.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46252341\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Titanium SDK 5.3.1.RC Release Note"});